    color: white;
  } */
`;

const Header = () => {
  return (
    <Menu>
      <List>
        <Item key="home">
          <Link href="/">
            <a>Logo</a>
          </Link>
        </Item>
        <Item key="mydirectory">
          <Link href="/mydirectory">
            <a>내 서재</a>
          </Link>
        </Item>
        <Item key="profile">
          <Link href="/profile">
            <a>내 정보</a>
          </Link>
        </Item>
        <Item>
          <Link href="/search">
            <a>Search</a>
          </Link>
        </Item>
      </List>
    </Menu>
  );
};

export default Header;
